import Graph from './Graph';


const LocationList = ({locationData}) => {
    const data = locationData.map(depth => {
        return <li 
        key={depth.depth_id}
        depth={depth}
        >{depth.depth_value}</li>
    });



    return(
        <div>
        <ul>{data}</ul>
        </div>
    )
}

export default LocationList;
